import "./Style/Books.css";
const Books = () => {
  let [book, setBook] = useState([]);
  let fetchApi = async () => {
    let apiData = await fetch("http://localhost:4000/books").then((res) =>
      res.json()
    );
    setBook(apiData);
  };
  fetchApi();

  // console.log(book.data)
  return (
    <>
      <div className="books">
        {book.map((elem) => {
          let {
            id,
            title,
            isbn,
            pagCount,
            publishedDate,
            thumbnailUrl,
            longDescription,
            status,
            authors,
            categories,
          } = elem;

          let{$date}=publishedDate
          return (
            <>
              <h1> {elem.id}</h1>
            </>
          );
        })}
      </div>
    </>
  );
};

export default Books;
